  /* Styling popup */
  #mobile-fullscreen-gif {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0.8);
    display: flex;
    justify-content: center;
    align-items: center;
    z-index: 9999; /* Increased z-index */
  }

  /* Hidden by default */
  .hidden {
    display: none !important; /* Added !important */
  }

  /* Styling gambar */
  #mobile-fullscreen-gif img {
    max-width: 90%;
    max-height: 90%;
    border-radius: 10px;
  }

  /* Tombol close */
  .close-btn {
    position: absolute;
    top: 20px;
    right: 20px;
    font-size: 24px;
    color: white;
    background-color: rgba(0, 0, 0, 0.5);
    width: 40px;
    height: 40px;
    display: flex;
    justify-content: center;
    align-items: center;
    border-radius: 50%;
    cursor: pointer;
    z-index: 10000; /* Higher z-index than the popup */
    user-select: none; /* Prevent text selection */
  }

  .close-btn:hover {
    background-color: rgba(0, 0, 0, 0.8); /* Efek hover */
  }
&lt;/style&gt;

&lt;script&gt;
  // Tunggu hingga DOM sepenuhnya dimuat
  document.addEventListener(&quot;DOMContentLoaded&quot;, function() {
    console.log(&quot;DOM fully loaded and parsed&quot;);

    // Dapatkan elemen popup dan tombol close
    const popup = document.getElementById(&quot;mobile-fullscreen-gif&quot;);
    const closeBtn = document.getElementById(&quot;close-popup-btn&quot;);

    // Tambahkan event listener pada tombol close
    closeBtn.addEventListener(&quot;click&quot;, function() {
      console.log(&quot;Tombol close diklik&quot;);
      popup.classList.add(&quot;hidden&quot;);
    });

    // Fungsi untuk mengecek ukuran layar
    function checkScreenSize() {
      console.log(&quot;Mengecek ukuran layar: &quot; + window.innerWidth + &quot;px&quot;);
      if (window.innerWidth &lt;= 768) {
        console.log(&quot;Layar mobile terdeteksi, menampilkan popup dalam 2 detik&quot;);
        // Hanya tampilkan popup jika di layar mobile
        setTimeout(function() {
          popup.classList.remove(&quot;hidden&quot;);
          console.log(&quot;Popup ditampilkan&quot;);
        }, 2000);
      } else {
        console.log(&quot;Layar desktop terdeteksi, popup tidak ditampilkan&quot;);
        // Pastikan popup tersembunyi di desktop
        popup.classList.add(&quot;hidden&quot;);
      }
    }

    // Jalankan pengecekan awal
    checkScreenSize();

    // Tambahkan event listener untuk resize
    window.addEventListener(&quot;resize&quot;, function() {
      console.log(&quot;Ukuran layar berubah&quot;);
      checkScreenSize();
    });
  });
